        #region METHODS
        public static void Init()
        {
            boundaries = ParseBoundaries();
            map1 = ParseToMap(0, mapWidth, 0, mapLength);
            map2 = ParseToMap(0, mapWidth, 60, mapLength);
            map3 = ParseToMap(rowWidth - mapWidth, rowWidth, 60, mapLength);
        }
        private static List<List<long>> ParseBoundaries()
        {
            List<List<long>> temp = new List<List<long>>();
            for (int i = 0; i < rawBoundaries.Count / rowLength; i++)
            {
                temp.Add(rawBoundaries.GetRange(i * rowLength, rowLength));
            }

            return temp; 
        }

        private static List<List<long>> ParseToMap(int startRow, int stopRow, int startCol, int endCol)
        {
            List<List<long>> map = new List<List<long>>();
            for (int row = startRow; row < stopRow; row++)
            {
                List<long> temp = boundaries[row];
                map.Add(temp.GetRange(startCol, endCol));
            }

            return map;
        }

        public static List<List<long>> ImportMap1()
        {
            return map1;
        }

        public static List<List<long>> ImportMap2()
        {
            return map2;
        }

        public static List<List<long>> ImportMap3()
        {
            return map3;
        }
